import React, { Component, Fragment } from 'react';

class List extends Component {

    render() {
        return (
        	<Fragment>
	           	{ 
	           		this.props.tasks.map((item, index) =>  <li key = {index}>{item.name}</li>)
	           	}	
	        </Fragment>
        );
    }
}

export default List;
